A space is a container for pages. It is made of all the pages in that space. In other words it's **a set of pages grouped together under the same name.** You may have noticed the notation [Space.Page]. This is a link to the page named "Page" in the "Space" space. Thus a page is uniquely identified by both its name and its space name. For XWiki.org for instance, the content is organized within the spaces listed on the right (they are the spaces for this sub-wiki).

This type of organization helps in creating a taxonomy whereby you have the ability to create subdivisions (e.g., server.name/Wiki/XWiki) to better organize information and manage [[rights>>Features.RightsManagement]] more easily on your XWiki.

Note that XWiki currently doesn't support nested spaces (nor nested pages) but pages can have parents. Starting with XWiki 2.5, to set the parent for a page click the pencil located after the breadcrumbs, in edit mode:

{{image reference="Features.Spaces@SetParentEditMode.png"/}}

After you have set the parent for that page the change will be reflected in the breadcrumb navigation:

{{image reference="Features.Spaces@SetParentEditModeSecondPart.png"/}}

Setting parents to pages allows for easy creation of hierarchies, as deep as you want.

{{info}}
Starting with XWiki Enterprise 4.1, a new features called "Hide Technical Content Spaces" was introduced. Because of this, certain spaces (ColorThemes, Panels, etc) will not be visible in the Spaces macro. If a space has all its pages marked as hidden, then the space itself will become hidden.
{{/info}}

On your wiki's homepage you will see a list of all available spaces:

{{image reference="Features.Spaces@SpaceHomepage.PNG"/}}

= Space creation =

Spaces are **created implicitly and automatically** as soon as one page is created with its name as the page space name. For example if you create a link in a page to [NewSpace.Page], the first time you click on the link to create the page the "NewSpace" space will be created and the page will be saved inside it.

Starting with XWiki 2.6, you can create a new space by using the Add menu:

{{image reference="Features.Spaces@CreateSpaceFromMenu.png"/}}

Fill in the Space homepage name and click "Create":

{{image reference="Features.Spaces@CreateSpaceConfirm.png"/}}

{{info}}
Starting with the 3.4 release you can create [[simple space templates>>xwiki:ReleaseNotes.ReleaseNotesXWikiEnterprise34#HSimplespacetemplates]]
{{/info}}

On XE you can choose one of the two default templates to use for the homepage of the new space: 

* a blank homepage
* a space dashboard

Of course more space templates can be created and used when first creating a space.

You can also **create spaces straight from the homepage** by clicking the "Create a new space" link as presented below:

{{image reference="Features.Spaces@CreateSpaceHomepage.PNG"/}}

= Deleting a space =

In order to delete a space you have to delete all the pages in that space. 

{{info}}
Starting with the 3.4 release you can delete spaces directly from the "Space" menu.
{{/info}}

Hover over the "Space" menu and click on "Delete".

{{image reference="Features.Spaces@DeleteSpace.png"/}}

This way, all the pages of that space will be moved to the recycle bin. To restore the space, you will have to restore its pages one by one. To do so, click on "View the list of documents from this space that are currently present in the Recycle Bin".

{{image reference="Features.Spaces@SpaceRecycleBin.png"/}}

You will be redirected to "Main.AllDocs" in which the livetable displays the "Deleted Documents" tab which stands for the Recycle Bin. There for each page you have 2 options:

* To restore a page, click on the corresponding green icon located in the last column of the livetable.
* To empty the Recycle bin : click on the red cross icon for each page you want to delete permanently (!) this operation can not be undone.

{{image reference="Features.Spaces@RestorePage.png"/}}

= Snippets for spaces =

* If you want to list all the spaces in your wiki, check out the [["List All Spaces" code snippet>>extensions:Extension.List All Spaces]].
* You can also use the [[Space deletion snippet>>extensions:Extension.Delete Space]] to delete all pages in a space (hence the space itself) at once.
* If you want to rename a full space, see the [[Space Rename Snippet>>extensions:Extension.Rename Space]].
